/*Table structure for table `contact_types` */

DROP TABLE IF EXISTS `contact_types`;

CREATE TABLE `contact_types` (
  `contacttypeid` int(11) NOT NULL AUTO_INCREMENT,
  `contacttype` varchar(100) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '1',
  `createddate` datetime NOT NULL,
  `updateddate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`contacttypeid`),
  UNIQUE KEY `contacttype_UNIQUE` (`contacttype`),
  KEY `contacttypestatus_idx` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1 COMMENT='Master table for contact types';

