  PRIMARY KEY (`contactid`),
  UNIQUE KEY `username_UNIQUE` (`username`),
  KEY `contacttyperef_idx` (`contacttypeid`),
  KEY `contactaccountref_idx` (`accountid`),
  KEY `contactstatus_idx` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=88 DEFAULT CHARSET=latin1 COMMENT='table to track contacts for an account';

